import React from "react";
import { useParams } from "react-router-dom";

function Article() {
  let { id } = useParams();

  const idArticle = replace(/[^0-9]+/g, "");
  const idTable = id.replace(/[0-9]+/g, "");

  return <div>Article {idArticle + " - " + idTable}</div>;
}

export default Article;
